import React from 'react';
import Logo from '../Images/MIS SERVICES REQUEST (1).png';
import Logo1 from '../Images/carsucc.png';

const Header = () => {
	return (
		<div className='header'>
			<div className='logo'>
				<h1 className='logocolor'>
          <div>
          <div>
						<img src={Logo1} alt='logo' width='150' height='100' />
					</div>
					<div>
						<img src={Logo} alt='logo' />
					</div>
          </div>

				</h1>
				<h2 className='color2'></h2>
			</div>
		</div>
	);
};
export default Header;
